import React, {Component} from "react";

import Box from '@mui/material/Box';
import Slider from '@mui/material/Slider';

class Home extends Component {

    constructor() {
        super();
        this.state = {
            value: 20,
            setValue: 37,
        }
    }

    marks = [
        {
            value: 0,
            label: '0°C',
        },
        {
            value: 5,
            label: '20°C',
        },
        {
            value: 10,
            label: '40°C',
        },
        {
            value: 60,
            label: '60°C',
        },
        {
            value: 80,
            label: '80°C',
        },
        {
            value: 40,
            label: '100°C',
        },
    ];


    valuetext(value) {
        return `${value}°C`;
    }

    handleChange = (event, newValue) => {
            this.setState({value: newValue })
    };

        render()
        {
            return (
                <div>
                    <h1>Settings</h1>
                    <p>Please choose your settings:</p>
                    <div style={{
                        display: "flex",
                        justifyContent: "center",
                        alignItems: "center",
                        margin: 200 }}>

                    <Box sx={{width: 500}}>
                        <Slider
                            getAriaLabel={() => 'Temperature range'}
                            marks={this.marks}
                            value={this.state.value}
                            onChange={this.handleChange}
                            valueLabelDisplay="auto"
                            getAriaValueText={this.valuetext}

                        />
                    </Box>
                    </div>
                </div>
            )
        }

}

export default Home;
